import React, { Component } from "react";
import "./weather.min.css"

class RainAnimTest extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className='weather rain'></div>
    );
  }
}

export default RainAnimTest;
